import React from 'react';
import { Link } from 'react-router-dom';
import { Menu, Icon, Dropdown, Segment, Select} from 'semantic-ui-react';

function NavBar({ currentUser, setCurrentUser }) {

    function logout(){
        setCurrentUser(null);
    }

    return(

        <Menu className="ui selection dropdown">
            <Dropdown attached="top" name="dropdown">
                <Dropdown.Menu className="default text">
                    <Dropdown.Item  as={Link} to="/">
                        Raregifs
                    </Dropdown.Item>
                    <Dropdown.Item  as={Link} to="/users">
                        Collections
                    </Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
        </Menu>
    ); 
}

export default NavBar;
